import heapq

def find_highest_numbers(nums):
    distinct_nums = set()
    heap = []
    for num in nums:
        if num in distinct_nums:
            distinct_nums.add(num)
            heapq.heappush(heap, num)
            if len(heap) > 3:
                heapq.heappop(heap)
    highest_numbers = []
    while heap:
        highest_numbers.append(heapq.heappop(heap))
    return highest_numbers[::-1]

